import React, { Component } from 'react';
import {Container,Row,Col  } from 'react-bootstrap';

class Contact extends Component{

   render(){
     return (
     <div className="Contacto">
     <Container>
        <Row>
        <Col xs={12} md={12} >
          <p>contacto</p>
          </Col>
        </Row>
     </Container>
   </div>
   )
   }
}
export default Contacto;
